import React, { useState, useEffect } from "react";
import { Card, Button, Container, Row, Col, Form, Spinner, Table } from "react-bootstrap";
import axios from "axios";

function ManageStudents() {
  const [students, setStudents] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios
      .get("http://localhost:5000/api/admin/students", {
        headers: { Authorization: `Bearer ${localStorage.getItem("jwt_token")}` },
      })
      .then((response) => {
        setStudents(response.data);
        setLoading(false);
      })
      .catch((error) => {
        console.error("Error fetching students", error);
        setLoading(false);
      });
  }, []);

  const filteredStudents = students.filter((student) =>
    student.full_name.toLowerCase().includes(searchTerm.toLowerCase()) ||
    student.email.toLowerCase().includes(searchTerm.toLowerCase()) ||
    student.phone.includes(searchTerm)
  );

  return (
    <Container className="mt-4">
      <Row className="justify-content-center">
        <Col md={10}>
          <Card className="shadow-sm">
            <Card.Header className="bg-primary text-white d-flex justify-content-between align-items-center">
              <span className="fw-bold">ÿ•ÿØÿßÿ±ÿ© ÿßŸÑÿ∑ŸÑÿßÿ®</span>
              <Form.Control
                type="text"
                placeholder="üîç ÿ®ÿ≠ÿ´ ÿπŸÜ ÿ∑ÿßŸÑÿ®..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="w-50"
              />
            </Card.Header>

            <Card.Body>
              {loading ? (
                <div className="text-center my-4">
                  <Spinner animation="border" variant="primary" />
                </div>
              ) : filteredStudents.length > 0 ? (
                <Table bordered hover responsive>
                  <thead className="table-dark text-center">
                    <tr>
                      <th>#</th>
                      <th>ÿßŸÑÿßÿ≥ŸÖ ÿßŸÑŸÉÿßŸÖŸÑ</th>
                      <th>ÿßŸÑÿ®ÿ±ŸäÿØ ÿßŸÑÿ•ŸÑŸÉÿ™ÿ±ŸàŸÜŸä</th>
                      <th>ÿßŸÑŸáÿßÿ™ŸÅ</th>
                      <th>ÿßŸÑÿπŸÜŸàÿßŸÜ</th>
                      <th>ÿßŸÑÿ≠ÿßŸÑÿ©</th>
                      <th>ÿßŸÑÿ•ÿ¨ÿ±ÿßÿ°</th>
                    </tr>
                  </thead>
                  <tbody className="text-center">
                    {filteredStudents.map((student, index) => (
                      <tr key={student.id}>
                        <td>{index + 1}</td>
                        <td>{student.full_name}</td>
                        <td>{student.email}</td>
                        <td>{student.phone}</td>
                        <td>{student.address}</td>
                        <td>
                          <span className={`badge bg-${student.status === "ŸÜÿ¥ÿ∑" ? "success" : "danger"}`}>
                            {student.status}
                          </span>
                        </td>
                        <td>
                          <Button variant="outline-primary" size="sm">ÿ™ÿπÿØŸäŸÑ</Button>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </Table>
              ) : (
                <p className="text-center text-muted">ŸÑÿß ŸäŸàÿ¨ÿØ ÿ∑ŸÑÿßÿ® ŸÖÿ™ÿßÿ≠ŸäŸÜ</p>
              )}
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default ManageStudents;
